import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import { createRoot } from 'react-dom/client';
import App from './App';
import './index.css';

ReactDOM.render(
  <Router>
    <createRoot/>
    <App />
  </Router>,
  document.getElementById('root')
);
